export class Delete extends React.Component {
  eliminar(id) {
    this.preventDefault();

    console.log(id);
  }

  render() {
    return (
      <div>
        <button onClick={this.eliminar(this.props.id)}>Eliminar</button>
      </div>
    );
  }
}
